const ProductsPage = () => {
  return (
    <>
      <CmsClients />
      <CmsBanner />
      <CmsDemo />
      <CmsExperience />
      <CmsIntegrate />
      <CmsProducts />
      <CmsResources />
      <Footer />
      <MailchimpForm />
      
    </>
  )
}

export default About
